script: |
  super -f text -I q5457.spq | sort > q5457.out

inputs:
  - name: q5457.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE + - col0 NOT BETWEEN 17 AND NULL OR NOT - col2 BETWEEN ( + 64 ) AND 18 + + CAST ( col2 AS INTEGER );
  - name: tab1

outputs:
  - name: q5457.out
    data: |
      51	14	96
      85	5	59
      91	47	68
